exports=async function(url,bid,cid,options){const{parseContent,collectLines}=await require("transcode/parse_content");return parseContent(url,null,{clientOptions:{...(options&&options.clientOptions)},parser:async html=>{const args=html.subRegexMap(/\)\.html\(d\("(?<a>[^"]+)",\s*"(?<b>[^"]+)"\)/);if(!args.a)return null;const CryptoJS=(await require("third-party/crypto-js"))(["md5","aes"]);let b=CryptoJS.MD5(args.b).toString();const d=CryptoJS.enc.Utf8.parse(b.substring(0,16)),e=CryptoJS.enc.Utf8.parse(b.substring(16)),fragment=CryptoJS.AES.decrypt(args.a.replace(/\\/g,""),e,{iv:d,padding:CryptoJS.pad.Pkcs7}).toString(CryptoJS.enc.Utf8),result=[];return collectLines(fragment,result),result}})};